import React, { Component } from "react";
import Modal from "./components/Modal";
import axios from "axios";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      operators: []
    };
  }
  componentDidMount() {
    this.refreshList();
  }
  refreshList = () => {
    axios
      .get("http://localhost:9001/admin/siegeapi/siege/")
      .then(res => this.setState({ operators: res.data }))
      .catch(err => console.log(err));
  };
  render() {
    return (
      <div>
        <div>Operators</div>
        <main className="content">
          <h1 className="text text-uppercase text-center my-4">Operators</h1>
          {this.state.modal ? (
            <Modal
              Operator={this.state.operators}
            />
          ) : null}
        </main>
      </div>
    );
  }
}
export default App;
